import { Container } from "../Summary/style";
import icomeImg from "../../assets/income.svg";

export function Summary() {
    return(
      <Container>
        <div>
          <header>
            <p>Entratas</p>
            <img src={icomeImg} alt="icone de entrada" />
          </header>
          <strong>1.000.00</strong>
        </div>

      </Container>

    );
}
